import{_ as a,E as r,c as o,J as l,m as e,a as i,ab as n,o as h}from"./chunks/framework.CUflZczI.js";const _=JSON.parse('{"title":"PX4-Autopilot v1.14 Нотатки щодо релізу","description":"","frontmatter":{},"headers":[],"relativePath":"uk/releases/1.14.md","filePath":"uk/releases/1.14.md"}'),u={name:"uk/releases/1.14.md"},s=e("h1",{id:"px4-autopilot-v1-14-нотатки-щодо-релізу",tabindex:"-1"},[i("PX4-Autopilot v1.14 Нотатки щодо релізу "),e("a",{class:"header-anchor",href:"#px4-autopilot-v1-14-нотатки-щодо-релізу","aria-label":'Permalink to "PX4-Autopilot v1.14 Нотатки щодо релізу"'},"​")],-1),c=n('<h2 id="прочитаите-перед-оновленням" tabindex="-1">Прочитайте перед оновленням <a class="header-anchor" href="#прочитаите-перед-оновленням" aria-label="Permalink to &quot;Прочитайте перед оновленням&quot;">​</a></h2><p>The v1.14 release includes a few breaking changes for users upgrading from previous versions, in particular we are moving away from using mixer files to define the vehicle geometry, motor mappings and actuators.</p><p>Additionally, we deprecated the Fast-RTPS interface used by ROS 2 in favor of a much cleaner solution that doesn&#39;t require a custom build target, and goes away with the additional message generation step.</p><p>Please continue reading for <a href="#upgrade-guide">upgrade instructions</a>.</p><h2 id="основні-зміни" tabindex="-1">Основні зміни <a class="header-anchor" href="#основні-зміни" aria-label="Permalink to &quot;Основні зміни&quot;">​</a></h2><ul><li>Динамічне розподілення керування</li><li>Покращена звітність про перевірку помилок передпольотної підготовки</li><li>Спрощення та симуляція аварійного режиму</li><li>Стандартна симуляція тепер - Новий Gazebo</li><li>Покращений інтерфейс ROS 2 завдяки uXRCE-DDS</li></ul><h3 id="динамічнии-розподіл-управління" tabindex="-1">Динамічний розподіл управління <a class="header-anchor" href="#динамічнии-розподіл-управління" aria-label="Permalink to &quot;Динамічний розподіл управління&quot;">​</a></h3><p>We are very excited to enable the new <a href="./../concept/control_allocation.html">dynamic control allocation</a> by default; it allows users to define vehicle configurations at runtime without needing a mixer file, thanks to the new <a href="./../config/actuators.html">vehicle setup dashboard</a> in QGroundControl.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The new actuator configuration UI is available on QGroundControl 4.2.0 or newer.</p></div><h3 id="покращена-звітність-про-перевірку-помилок-передпольотноі-підготовки-qgc-arming-checks-ui" tabindex="-1">Покращена звітність про перевірку помилок передпольотної підготовки (QGC Arming Checks UI) <a class="header-anchor" href="#покращена-звітність-про-перевірку-помилок-передпольотноі-підготовки-qgc-arming-checks-ui" aria-label="Permalink to &quot;Покращена звітність про перевірку помилок передпольотної підготовки (QGC Arming Checks UI)&quot;">​</a></h3><p>PX4 v1.14 adds much improved preflight failure <em>reporting</em> through the <a href="./../concept/events_interface.html">events interface</a>. If the vehicle won&#39;t arm, you can more easily find out why in the <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/fly_view/fly_view.html#arm" target="_blank" rel="noreferrer">QGC Arming Checks UI</a>. No more wondering if it&#39;s a problem with the safety switch, a poor calibration, or something in the internals of the estimator!</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The QGC Arming Checks UI is available in the <strong>QGC Daily Build</strong> (QGC v4.2.0 and later)</p></div><p>As part of this change, it is now possible to switch to any mode when disarmed (previously you could not switch to a mode that required GPS if you didn&#39;t have a good position estimate). PX4 will only allow you to arm when the conditions for the current mode are met, and will report failure checks that are not relevant to the current mode as warnings.</p><h3 id="спрощення-аваріиного-режиму" tabindex="-1">Спрощення аварійного режиму <a class="header-anchor" href="#спрощення-аваріиного-режиму" aria-label="Permalink to &quot;Спрощення аварійного режиму&quot;">​</a></h3><p><a href="./../config/safety.html">Safety Failsafe</a> handling has been simplified, in particular with respect to what happens if a failsafe is triggered when another failsafe is already in progress.</p><ul><li>Тепер перед виконанням дії є затримка утримання, що дає користувачеві час для скасування аварійного режиму, якщо це необхідно.</li><li>Якщо спрацьовують декілька аварійних режимів, вживається більш сувора <em>дія</em>. Наприклад, якщо втрачені як радіо контроль, так і GPS, і втрата керування вручну встановлена в режим Повернутися, а втрата зв&#39;язку з GCS встановлена в режим Посадка, виконується Посадка.</li></ul><p>The new <a href="./../config/safety_simulation.html">Failsafe State Machine Simulation</a> allows you to test failsafe behaviour under all possible configurations and conditions.</p><h3 id="новии-gazebo" tabindex="-1">Новий Gazebo <a class="header-anchor" href="#новии-gazebo" aria-label="Permalink to &quot;Новий Gazebo&quot;">​</a></h3><p>Given <a href="https://discourse.ros.org/t/a-new-era-for-gazebo-cross-post/25012" target="_blank" rel="noreferrer">the recent changes</a> by the Open Robotics simulation team, we are introducing name changes for our gazebo simulations, mirroring Open Robotics naming scheme, starting with v1.14:</p><ul><li><a href="https://docs.px4.io/v1.13/en/simulation/ignition_gazebo.html" target="_blank" rel="noreferrer">Ignition Gazebo</a> до <a href="./../sim_gazebo_gz/">Gazebo</a></li><li><a href="https://docs.px4.io/v1.13/en/simulation/gazebo.html" target="_blank" rel="noreferrer">Gazebo</a> до <a href="./../sim_gazebo_classic/">Gazebo Classic</a>.</li></ul><p>Most importantly this affects the PX4 build target names as well:</p><ul><li>Цілі Gazebo мають префікс <code>gz_</code> (наприклад, <code>make px4_sitl gz_x500</code>).</li><li>Класичні цілі <code>make</code> Gazebo тепер мають префікс <code>gazebo-classic_</code> (наприклад, <code>make px4_sitl gazebo-classic_cloudship</code>).</li></ul><h3 id="покращении-інтерфеис-ros-2-за-допомогою-uxrce-dds" tabindex="-1">Покращений інтерфейс ROS 2 за допомогою uXRCE-DDS <a class="header-anchor" href="#покращении-інтерфеис-ros-2-за-допомогою-uxrce-dds" aria-label="Permalink to &quot;Покращений інтерфейс ROS 2 за допомогою uXRCE-DDS&quot;">​</a></h3><p>We updated the ROS 2 interface, replacing <a href="https://docs.px4.io/v1.13/en/middleware/micrortps.html" target="_blank" rel="noreferrer">Fast-RTPS</a> with <a href="./../ros2/user_guide.html">uXRCE-DDS</a>, resulting in an improved experience across the board. The change also avoids the need for <code>_rtps</code> build targets, enabling the interface on even more targets by default.</p><h2 id="інструкціі-для-оновлення" tabindex="-1">Інструкції для оновлення <a class="header-anchor" href="#інструкціі-для-оновлення" aria-label="Permalink to &quot;Інструкції для оновлення&quot;">​</a></h2><p>For users upgrading from previous versions, please take a moment to review the following:</p><ol><li><p>Для змін актуатора необхідно перевірити геометрію автомобіля та зв&#39;язки моторів/сервоприводів з вашим автомобілем. У QGC знайдіть <a href="./../config/actuators.html">Панель конфігурації приводів</a>, і переконайтеся, що геометрія корпусу відповідає фактичним даним з вашого транспортного засобу, а також оновіть двигун та переконайтеся, що двигуни та сервоприводи відображені на виходах так, як вони підключені до корпусу і з правильно вказаним типом регулятора швидкості. Примітка: скористайтеся повзунками в користувацькому інтерфейсі. Вони можуть бути використані для підтвердження з&#39;єднання моторів.</p><p>Ми настійно рекомендуємо провести <a href="./../advanced_config/esc_calibration.html">калібрування ESC </a>, якщо використовуєте двигуни ESC по КШТ, а потім встановити відповідні мінімальні та максимальні значення вимкнення для двигунів (у UI приводу).</p><p>Калібрування є критичним, якщо ви використовуєте власний файл змішувача або повітряну конструкцію, яку ви призначили в попередній версії, немає в PX4 v1.14.</p><p>Однак рекомендується провести калібрування ESC <strong>навіть якщо</strong> ви використовуєте повітряну раму, яка точно відповідає конкретному транспортному засобу в <a href="./../airframes/airframe_reference.html">Довіднику з рамами</a> (такі як <a href="./../airframes/airframe_reference.html#copter_quadrotor_x_holybro_x500_v2">Holybro X500 V2</a>), оскільки ваші з&#39;єднання та калібрування ESC можуть не відповідати значенням за замовчуванням.</p></li><li><p>Змінено значення вимкненого PWM за замовчуванням з 900 мкс на 1000 мкс. Перевірте, чи ви раніше використовували значення роззброєння PWM за замовчуванням і якщо зміни впливають на вашу настройку. Для отримання детальної інформації ви можете знайти відповідні дані у документі <a href="./../advanced_config/esc_calibration.html#steps">кроці 7 калібрування ESC</a>.</p></li><li><p>Користувачам Fast-RTPS потрібно перенести свій код на новий інтерфейс uXRCE-DDS. Код програми повинен вимагати лише незначних модифікацій. Це включає (мінімально):</p></li></ol><p>Modifying topic names to match the new naming pattern, which changed from <code>fmu/&lt;topic_name&gt;/out</code> to <code>fmu/out/&lt;topic_name&gt;</code>, and <a href="./../ros2/user_guide.html#ros-2-subscriber-qos-settings">Adusting the QoS settings</a>.</p><p>For more information see <a href="./../middleware/uxrce_dds.html#fast-rtps-to-uxrce-dds-migration-guidelines">Fast-RTPS to uXRCE-DDS Migration Guidelines</a></p><h2 id="інші-зміни" tabindex="-1">Інші зміни <a class="header-anchor" href="#інші-зміни" aria-label="Permalink to &quot;Інші зміни&quot;">​</a></h2><h3 id="підтримка-обладнання" tabindex="-1">Підтримка обладнання <a class="header-anchor" href="#підтримка-обладнання" aria-label="Permalink to &quot;Підтримка обладнання&quot;">​</a></h3><ul><li>Cubepilot Cube Orange+ - <a href="https://github.com/PX4/PX4-Autopilot/pull/20304" target="_blank" rel="noreferrer">PX4-Autopilot#20304</a></li><li>Unicore GPS: Підтримка Holybro Unicore UM982 GPS - <a href="https://github.com/PX4/PX4-Autopilot/pull/21214" target="_blank" rel="noreferrer">PX4-Autopilot#21214</a>)</li><li>Покращена підтримка VOXL2 - <a href="https://github.com/PX4/PX4-Autopilot/pull/21426" target="_blank" rel="noreferrer">PX4-Autopilot#21426</a></li><li>Виявлення Cubepilot Cube Black: виправлено виявлення Cube Black порівняно з виявленням Pixhawk 2 з підключеним CAN1 - <a href="https://github.com/PX4/PX4-Autopilot/pull/21342" target="_blank" rel="noreferrer">PX4-Autopilot#21342</a></li></ul><h3 id="загальні" tabindex="-1">Загальні <a class="header-anchor" href="#загальні" aria-label="Permalink to &quot;Загальні&quot;">​</a></h3><ul><li>Перезапис стану аварійної безпеки та <a href="./../config/safety_simulation.html">імітація у веб-середовищі</a></li><li>Покращена звітність про невдачу контролю передпольотної перевірки (необхідно QGC <a href="https://github.com/mavlink/qgroundcontrol/releases/tag/v4.2.0" target="_blank" rel="noreferrer">v4.2.0</a> або пізніше): <a href="https://github.com/PX4/PX4-Autopilot/pull/20030" target="_blank" rel="noreferrer">PX4-Autopilot#20030</a> та <a href="https://github.com/mavlink/qgroundcontrol/pull/10362" target="_blank" rel="noreferrer">qgroundcontrol#10362</a></li><li><a href="./../advanced/package_delivery.html">Доставка посилок у місії</a>: Для додатків з доставкою посилок, була додана початкова підтримка доставки навантаження у місії для приводу захвату</li><li>Переопределення повідомлення задання ручного керування: <code>manual_control_setpoint.x</code>, <code>y</code>, <code>z</code>, <code>w</code> -&gt; <code>roll</code>, <code>pitch</code>, <code>yaw</code>, <code>throttle</code>; <code>throttle scale [0,1] -&gt; [-1,1]</code> - <a href="https://github.com/PX4/PX4-Autopilot/pull/15949" target="_blank" rel="noreferrer">PX4-Autopilot#15949</a></li><li>Стандартна конфігурація PWM мотора - <a href="https://github.com/PX4/PX4-Autopilot/pull/21800" target="_blank" rel="noreferrer">PX4-Autopilot#21800</a></li><li>Виправлення калібрування PWM/Oneshot - <a href="https://github.com/PX4/PX4-Autopilot/pull/21726" target="_blank" rel="noreferrer">PX4-Autopilot#21726</a></li></ul><h3 id="управління" tabindex="-1">Управління <a class="header-anchor" href="#управління" aria-label="Permalink to &quot;Управління&quot;">​</a></h3><ul><li>Вилітайте та знову вилітайте у місію: Посадка не деактивується, якщо місія не виконана - <a href="https://github.com/PX4/PX4-Autopilot/pull/19659" target="_blank" rel="noreferrer">PX4-Autopilot#19659</a></li><li>Окреме повідомлення цілі окреме тепер від повідомлення місцевого положення транспортного засобу. - <a href="https://github.com/PX4/PX4-Autopilot/pull/19622" target="_blank" rel="noreferrer">PX4-Autopilot#19622</a></li><li>Виправлення помилки: повідомлення &quot;Недійсна встановлена точка&quot; при зльоті або перемиканні режиму: Повідомлення вибивалося як помилкове залежно від часу - <a href="https://github.com/PX4/PX4-Autopilot/pull/20581" target="_blank" rel="noreferrer">PX4-Autopilot#20581</a></li><li>Виправлення помилки: Переключення кроку висота на позицію: Перемикання з висоти на позицію зі швидкістю викликало різкі кроки - <a href="https://github.com/PX4/PX4-Autopilot/pull/20905" target="_blank" rel="noreferrer">PX4-Autopilot#20905</a></li></ul><h3 id="оцінки" tabindex="-1">Оцінки <a class="header-anchor" href="#оцінки" aria-label="Permalink to &quot;Оцінки&quot;">​</a></h3><ul><li><a href="./../advanced_config/tuning_the_ecl_ekf.html#height">Об&#39;єднання джерел різної висоти</a></li><li>EKF2 починає працювати без даних магнітомера та барометра: До цього часу, магнітозахист та барометр були обов&#39;язковими для запуску EKF2 - <a href="https://github.com/PX4/PX4-Autopilot/pull/20021" target="_blank" rel="noreferrer">PX4-Autopilot#20021</a></li><li>Покращення оцінки вітру для багатовертольотників: більш точна модель опору тіла вигону - <a href="https://github.com/PX4/PX4-Autopilot/pull/20848" target="_blank" rel="noreferrer">PX4-Autopilot#20848</a></li></ul><h3 id="сенсори" tabindex="-1">Сенсори <a class="header-anchor" href="#сенсори" aria-label="Permalink to &quot;Сенсори&quot;">​</a></h3><ul><li><a href="./../dronecan/#dronecan-subscriptions-publications">Датчики DroneCAN тепер потрібно окремо активувати за допомогою параметрів <code>UAVCAN_SUB_*</code></a> - <a href="https://github.com/PX4/PX4-Autopilot/pull/18471" target="_blank" rel="noreferrer">PX4-Autopilot#18471</a></li><li>Налаштування оцінки батареї, покращення звітності: Налаштування за замовчуванням: компенсація навантаження з урахуванням поточного стану, вища напруга на порожній клітині, коротший час затримки дії - <a href="https://github.com/PX4/PX4-Autopilot/pull/19429" target="_blank" rel="noreferrer">PX4-Autopilot#19429</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19700" target="_blank" rel="noreferrer">PX4-Autopilot#19700</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19594" target="_blank" rel="noreferrer">PX4-Autopilot#19594</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19679" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/pull/19679</a></li><li>Драйвер серійного обертального лідару SF45 - <a href="https://github.com/PX4/PX4-Autopilot/pull/19891" target="_blank" rel="noreferrer">PX4-Autopilot#19891</a></li></ul><h3 id="симуляція" tabindex="-1">Симуляція <a class="header-anchor" href="#симуляція" aria-label="Permalink to &quot;Симуляція&quot;">​</a></h3><ul><li>[Gazebo] Запалювання Паливо для PX4: Тепер у PX4 є сховище для моделей gazebo в ignition fuel - <a href="https://app.gazebosim.org/PX4" target="_blank" rel="noreferrer">https://app.gazebosim.org/PX4</a></li><li>[Gazebo] Підтримка саду Gazebo з підтримкою місцевого транспорту запалювання: Додана підтримка місцевого транспорту запалювання для прямого взаємодії з Gazebo та симуляцією. Підтримувані транспортні засоби в Gazebo - X500 (баготарковий коптер), Літак, Стандартний VTOL - <a href="https://github.com/PX4/PX4-Autopilot/pull/20319" target="_blank" rel="noreferrer">PX4-Autopilot#20319</a></li><li>[Gazebo-classic] Серіалізатор для Gazebo sniffer: Доданий sniffer для серіалізації інформації, пов&#39;язаної з gazebo - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/937" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#937</a></li><li>[Gazebo-classic] Плагін відмови двигуна як плагін ros2: Плагін відмови двигуна було оновлено як плагін ros2 - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/862" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#862</a></li><li>[Gazebo-classic] Додавання моделі Омнікоптера: До Gazebo SITL була додана повністю актована модель омнідирекціонального транспортного засобу - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/866" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-SITL_gazebo-classic/pull/866</a></li><li>[Gazebo-classic] Додавання плагіна Advanced liftdrag: Удосконалений плагін Advanced liftdrag, який моделює нелінійну аеродинаміку на основі AVL - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/901" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#901</a></li><li>[Gazebo-classic] Додавання світу безпечної посадки: Додавання світу безпечної посадки для тестування безпечної посадки - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/93" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#93</a></li><li>[Gazebo-classic] Тестування Ubuntu Bionic, яке старіє. Видалено тестування через EOL Ubuntu Bionic - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/974" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#974</a></li><li>[SIH] Самостійні симуляції датчиків у дереві: Здатність симулювати датчики у дереві, яке було частиною SIH, тепер є самостійним модулем датчика. Датчики включають магнітометр, GPS, барометр, Індикатор швидкості повітря - <a href="https://github.com/PX4/PX4-Autopilot/pull/20137" target="_blank" rel="noreferrer">PX4-Autopilot#20137</a>, <a href="https://github.com/PX4/PX4-Autopilot/tree/release/1.15/src/modules/simulation/sensor_airspeed_sim" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/tree/release/1.15/src/modules/simulation/sensor_airspeed_sim</a></li><li>[SIH] Впровадження відмов для імітації акумулятора - <a href="https://github.com/PX4/PX4-Autopilot/commit/ebc1d7544e8146788c9e7cf5e8b64f60199240e4" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/commit/ebc1d7544e8146788c9e7cf5e8b64f60199240e4</a></li></ul><h3 id="mavlink" tabindex="-1">MAVLink <a class="header-anchor" href="#mavlink" aria-label="Permalink to &quot;MAVLink&quot;">​</a></h3><ul><li>Пересилання MAVLink через USB: Пересилати трафік MAVLink від / до USB за замовчуванням - <a href="https://github.com/PX4/PX4-Autopilot/pull/20745" target="_blank" rel="noreferrer">PX4-Autopilot#20745</a></li></ul><h3 id="мульти-ротор" tabindex="-1">Мульти-Ротор <a class="header-anchor" href="#мульти-ротор" aria-label="Permalink to &quot;Мульти-Ротор&quot;">​</a></h3><ul><li>Покращений режим &quot;Слідувати за мною&quot;: Режим слідування за мною був покращений для кращого користувацького досвіду - <a href="https://github.com/PX4/PX4-Autopilot/pull/18026" target="_blank" rel="noreferrer">PX4-Autopilot#18026</a> | <a href="https://www.youtube.com/watch?v=rYYso87cmxA" target="_blank" rel="noreferrer">Презентація PX4 Dev Summit</a></li><li>Покращена Підтримка Вертольотів: <a href="./../config_heli/">Конфігурація Вертольота</a></li><li>Швидкісні обмеження на підставі напрямку для багтроторів: можна визначити різну швидкість вперед, назад та боково - <a href="https://github.com/PX4/PX4-Autopilot/pull/19257" target="_blank" rel="noreferrer">PX4-Autopilot#19257</a></li><li>Дозволити кидання в режимі тримання: Дозволити пілоту кидати дрон у триманні - <a href="https://github.com/PX4/PX4-Autopilot/pull/21399" target="_blank" rel="noreferrer">PX4-Autopilot#21399</a></li></ul><h3 id="vtol" tabindex="-1">VTOL <a class="header-anchor" href="#vtol" aria-label="Permalink to &quot;VTOL&quot;">​</a></h3><ul><li>Quad-chute: дозволяє скинути стан відмови. Скинути стан неуспіху, як тільки оператор викликає перехід до ПЗ знову - <a href="https://github.com/PX4/PX4-Autopilot/pull/20913" target="_blank" rel="noreferrer">PX4-Autopilot#20913</a></li><li>Спростити переходи Tailsitter до FW в стабілізованому режимі: Автоматично адаптувати поріг нахилу до налаштованого максимального нахилу - <a href="https://github.com/PX4/PX4-Autopilot/pull/21582" target="_blank" rel="noreferrer">PX4-Autopilot#21582</a></li><li>Рефакторинг некомандного спуску Quad-Chute: Дозволяє встановити поріг помилки висоти для спрацювання Quad-chute - <a href="https://github.com/PX4/PX4-Autopilot/pull/21598" target="_blank" rel="noreferrer">PX4-Autopilot#21598</a></li><li>Увімкнути Quad-tailsitters без поверхні керування: Дозволяє використовувати різницю тяги для контролю положення всього тіла у режимі FW на хвостоподібниках - <a href="https://github.com/PX4/PX4-Autopilot/pull/20511" target="_blank" rel="noreferrer">PX4-Autopilot#20511</a></li><li>Пропустіть елемент місії VTOL_Takeoff, якщо вже у повітрі - <a href="https://github.com/PX4/PX4-Autopilot/pull/19985" target="_blank" rel="noreferrer">PX4-Autopilot#19985</a></li></ul><h3 id="літак-з-фіксованим-крилом" tabindex="-1">Літак з фіксованим крилом <a class="header-anchor" href="#літак-з-фіксованим-крилом" aria-label="Permalink to &quot;Літак з фіксованим крилом&quot;">​</a></h3><ul><li>Переробка закрилок / спойлера - <a href="https://github.com/PX4/PX4-Autopilot/pull/19329" target="_blank" rel="noreferrer">PX4-Autopilot#19329</a></li><li>Керування позицією FW: перемикання з керуванням L1 на NPFG - <a href="https://github.com/PX4/PX4-Autopilot/pull/19603" target="_blank" rel="noreferrer">PX4-Autopilot#19603</a> | <a href="https://www.youtube.com/watch?v=LY6hYBCdy-0" target="_blank" rel="noreferrer">Відео презентації на PX4 Dev Summit</a></li><li>Автоматично застосовувати вивчену шкалу повітряної швидкості в повітрі - <a href="https://github.com/PX4/PX4-Autopilot/pull/19787" target="_blank" rel="noreferrer">PX4-Autopilot#19787</a></li><li>Оновлення/вдосконалення зльоту - <a href="https://github.com/PX4/PX4-Autopilot/pull/19869" target="_blank" rel="noreferrer">PX4-Autopilot#19869</a></li><li>Переробка/вдосконалення посадкового рефакторингу - <a href="https://github.com/PX4/PX4-Autopilot/pull/19871" target="_blank" rel="noreferrer">PX4-Autopilot#19871</a></li><li>Масштабний мінімальна швидкість повітря зі силою вітру FW Контроль положення: додати можливість масштабування мінімальної швидкості повітря з величиною вітру - <a href="https://github.com/PX4/PX4-Autopilot/pull/20259" target="_blank" rel="noreferrer">PX4-Autopilot#20259</a></li><li>Покращити відправлення на руках - <a href="https://github.com/PX4/PX4-Autopilot/pull/20557" target="_blank" rel="noreferrer">PX4-Autopilot#20557</a></li><li>Покращити захист від прискореного стробування - <a href="https://github.com/PX4/PX4-Autopilot/pull/20636" target="_blank" rel="noreferrer">PX4-Autopilot#20636</a></li><li>Додати опцію вимкнення ручного введення курсу - <a href="https://github.com/PX4/PX4-Autopilot/pull/20647" target="_blank" rel="noreferrer">PX4-Autopilot#20647</a></li><li>Вимкнення введення швидкості повітря у оцінку швидкості повітря TECS виявилося ненадійним, тому ми вирішили вимкнути його наразі - <a href="https://github.com/PX4/PX4-Autopilot/pull/21317" target="_blank" rel="noreferrer">PX4-Autopilot#21317</a></li><li>Підтримка польотів з різними швидкостями Додавання швидкості до картування тримача газу в TECS для підтримки польоту з різними швидкостями - <a href="https://github.com/PX4/PX4-Autopilot/pull/21345" target="_blank" rel="noreferrer">PX4-Autopilot#21345</a></li><li>FWPositionControl: навігаціяМаршрутніТочки: виправлення логіки, якщо вже пройшли маршрутну точку - <a href="https://github.com/PX4/PX4-Autopilot/pull/21642" target="_blank" rel="noreferrer">PX4-Autopilot#21642</a></li></ul>',50);function p(f,b,g,d,m,P){const t=r("Badge");return h(),o("div",null,[s,l(t,{type:"tip",text:"Stable"}),c])}const k=a(u,[["render",p]]);export{_ as __pageData,k as default};
